import React from "react";
import "./Header.css";
import logoIMG from "./images/Logo.gif";
import {Link} from "react-router-dom";

class Header extends React.Component{
    
    state = {
        clicked: false,
        isLoading: true,
        results: [],
        value: "",
        name: ""
      };
      
    render() {
        return (      
            <nav className = "header">
                <div className = "logo">
                    <Link to ="/">
                        <img 
                        src = { logoIMG } 
                        alt = "HWASEON"
                        width = "200px"/>
                    </Link>
                </div>
            </nav>
        );
    }
}

export default Header;
